    }
    
    componentDidMount() {
      this.loadUsuarios();  
    }

    loadUsuarios = async () => {
      const response = await api.get('/usuario');

      console.log(response);
    }
    
    render() {
      return (
        <h1>Bodyyyyy</h1>
      );
    }
}
